import React from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Overlay from "./Overlay";
import SideSelectionOverlay from "./SideSelectionOverlay";
import t1Logo from "./assets/t1-logo.png";
import ktLogo from "./assets/kt-logo.png";

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/score" element={<Overlay />} />
        <Route
          path="/side/blue"
          element={<SideSelectionOverlay teamLogo={t1Logo} teamName="T1" side="blue" />}
        />
        <Route
          path="/side/red"
          element={<SideSelectionOverlay teamLogo={ktLogo} teamName="KT" side="red" />}
        />
      </Routes>
    </Router>
  );
}

export default App;
